import logo from './logo.svg';
import './App.css';
import React, {Component} from "react";

import UserList from "./components/User";


class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            'users': []
        }
    }

    componentDidMount() {
        const users = [
            {
                'username': 'alexgeek',
                'first_name': 'alex',
                'last_name': 'geek',
                'email': 'test@gmail.com',
            }
        ]
        this.setState({
                'users': users
            }
        )
    }

    render() {
        return (
            <div>
                <UserList users={this.state.users}/>
            </div>
        )
    }
}

export default App;
